import React from "react";
///////import axios from "axios";
class Ratingfeedback extends React.Component {
  state = {
    username: "",
    coursename: "",
  };
  render() {
    return (
      <div class="row text-center">
        <div class="col-md-4">
          <form>
            <p>Please input Username</p>
            <input
              value={this.state.username}
              style={{
                fontSize: "15px",
                fontFamily: "Cursive,sans-serif,Gugi",
                borderRadius: "10px",
                marginLeft: "100px",
                marginTop: "15px",
              }}
              placeholder="username"
              class="form-control"
              name="username"
            />
            <p>Please input Coursename</p>
            <input
              value={this.state.coursename}
              style={{
                fontSize: "15px",
                fontFamily: "Cursive,sans-serif,Gugi",
                borderRadius: "10px",
                marginLeft: "100px",
                marginTop: "15px",
              }}
              placeholder="coursename"
              class="form-control"
            />
            <p>Please Rate your Course</p>

            <p>
              <button
                style={{
                  borderRadius: "10px",
                  fontSize: "19px",
                  fontFamily: "Cursive,sans-serif,Gugi",
                  outline: "none",
                  color: "white",
                  backgroundColor: "#000066",
                  marginLeft: "100px",
                  marginTop: "20px",
                  width: "435px",
                }}
                class="btn"
              >
                SUBMIT
              </button>
            </p>
          </form>
        </div>
      </div>
    );
  }
}
export default Ratingfeedback;
